import React from 'react';


const Inscription = () => {
  return (
    <section className="wrap container">
      <form action="" className="offset-2 col-10">
        <div className="row">
          <input type="text" placeholder="Indiquez votre Pseudo"/>
        </div>
        <div className="row">
          <input type="text" placeholder="Indiquez votre mail"/>
        </div>
        <div className="row">
          <input type="text" placeholder="Choisissez un mot de passe"/>
        </div>
      </form>
    </section>
  )
}

export default Inscription;
